import './AddRecipe.css';

function AddRecipe() {

    function recipeAdd(name) {
        let title = document.getElementById("title");
        let s = document.getElementById("s");
        let text = document.getElementById("text");
        let author = document.getElementById("author");
        alert("Hello World " + name, title, s, text, author);
    }

    return(
        <main className="mainSection">
            <article className="mainArticle">
                <h1>Add new recipe</h1>
                <form id="addRecipeForm">
                    <input type="text" id="title" placeholder="Enter title"></input><br />
                    <input type="text" id="s" placeholder="Enter s"></input><br />
                    <input type="text" id="text" placeholder="Enter text"></input><br />
                    <input type="text" id="author" placeholder="Enter author"></input><br />
                    <button onClick={ () => { recipeAdd("Dusan") } }>Add</button>
                </form>
            </article>
        </main> 
    );
};

export default AddRecipe;
